    "Revolutionary Wake Hazard Assessment Tool Project",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T06:04:42.971506",nt"name": "revolutionary-wake-hazard-assessment-tool-project",nt"isopen":
    true,nt"url": null,nt"notes": "Continuum Dynamics, Inc. (CDI) has developed
    a Multiple Aircraft Simulation Tool (MAST) that revolutionizes the ability to predict
    and assess wake interactions associated with multiple aircraft operating in the
    vicinity of one another.  This tool incorporates CDI's state-of-the-art free-vortex
    wake modeling methods and aircraft wake diffusion and dissipation models within
    established flight simulation technology.   This new technology is ideally suited
    to support the U.S. air traffic management system in evaluating methods to safely
    improve operational efficiency.  The proposed effort is to enhance and repackage
    this technology in a manner targeted directly toward modeling "series" and "parallel"
    fixed (and rotary) wing aircraft approach patterns.  The large body of recent data
    obtained from field tests and advanced CFD will be utilized to provide a new level
    of accuracy and efficiency in the prediction of the influence of turbulence, wind
    shear, stratification and ground effect on vortex wake evolution and decay.  The
    final tool will be unprecedented in its range of application, accuracy and ease
    of use in modeling the wake interactions of multiple fixed wing and rotary-wing
    aircraft operating in a terminal area environment and will be ideal for planning
    and evaluating NASA's multiple corridor and simultaneous non-interference operational
    concepts.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
